import React from "react";
import "./style.css";
import Map from "./map_placeholder.png"

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <img src={Map} alt="map_placeholder" style={{position: "relative", paddingBottom: "25px"}}/>
    </div>
  );
}

export default Jumbotron;
